import React, { Component } from 'react';
import Slider from "react-slick";
import "./slider.scss";

class My_Slider extends Component {
    state = {}
    render() {
        let slidersettings = {
            dots: true,
            infinite: true,
            speed: 500,
            slidesToShow: 1,
            slidesToScroll: 1,
            fade: true,
        };
        return (
            <div className="homepage">
                <div className="homepage-slider">

                    <Slider {...slidersettings}>
                        <div>
                            <div className="item">
                                Pierwszy element

                            </div>
                        </div>


                        <div>
                            <div className="item">
                                Drugi element slidera
                             </div>
                        </div>
                    </Slider>
                </div>
            </div >
        );
    }
}

export default My_Slider;
